import Brand from '../Brand/Brand';

export default function BrandsContainer({data}) {
    return (
        <div class="container">
         <div class="row justify-content-md-center">
            <div class="col-sm-">
                {data.map((item,index)=>
                    <Brand key={index} data={item}></Brand>
                )}
            </div>
        </div>
        </div>
    )
}
